-- Minimal synthetic data for local/test envs (no PII).
-- Adjust to match your schema.

-- Roles
CREATE TABLE IF NOT EXISTS roles (
    roleid INT PRIMARY KEY,
    name VARCHAR NOT NULL,
    parentroleid INT NULL,
    -- Relationships
    CONSTRAINT fk_roles_parent FOREIGN KEY (parentroleid)
        REFERENCES public.roles (roleid)
        ON DELETE SET NULL
        ON UPDATE CASCADE
);
INSERT INTO public.roles (roleid, name, parentroleid) VALUES
    (1, 'Super Admin', NULL),
    (2, 'Admin', NULL),
    (3, 'Manager', 2),
    (4, 'Sales Lead', 3),
    (5, 'Sales Agent', 4)
ON CONFLICT (name) DO NOTHING;

-- Users
CREATE TABLE IF NOT EXISTS users (
    userid SERIAL PRIMARY KEY,
    name VARCHAR NOT NULL,
    email VARCHAR UNIQUE NOT NULL,
    passwordhash VARCHAR NOT NULL,
    roleid INT NULL,
    managerid INT NULL,
    departmentid INT NULL,
    createdat TIMESTAMPTZ NULL,
    updatedat TIMESTAMPTZ NULL,
    status VARCHAR NULL,
    lastlogin TIMESTAMPTZ NULL,

    -- Indexes
    CONSTRAINT uq_users_email UNIQUE (email),
    CONSTRAINT fk_users_role FOREIGN KEY (roleid)
        REFERENCES public.roles (roleid)
        ON DELETE SET NULL
        ON UPDATE CASCADE,
    CONSTRAINT fk_users_manager FOREIGN KEY (managerid)
        REFERENCES public.users (userid)
        ON DELETE SET NULL
        ON UPDATE CASCADE,
    CONSTRAINT fk_users_department FOREIGN KEY (departmentid)
        REFERENCES public.departments (departmentid)
        ON DELETE SET NULL
        ON UPDATE CASCADE
);
CREATE INDEX idx_users_managerid ON public.users (managerid);
CREATE INDEX idx_users_departmentid ON public.users (departmentid);
CREATE INDEX idx_users_roleid ON public.users (roleid);


